/*Table structure for table `barang` */

DROP TABLE IF EXISTS `barang`;

CREATE TABLE `barang` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `kode` varchar(64) DEFAULT NULL,
  `barcode` varchar(64) DEFAULT NULL,
  `nama` varchar(64) NOT NULL,
  `id_kategori_barang` int(11) NOT NULL,
  `id_jenis_barang` int(11) NOT NULL,
  `id_satuan` int(11) DEFAULT NULL,
  `id_satuan_beli` int(11) DEFAULT NULL,
  `minus` tinyint(1) NOT NULL DEFAULT '0',
  `id_rak_gudang` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_barang` (`id_jenis_barang`) USING BTREE,
  KEY `idx_barang_0` (`id_satuan`) USING BTREE,
  KEY `idx_barang_1` (`id_kategori_barang`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5041 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

