/*Table structure for table `languages` */

DROP TABLE IF EXISTS `languages`;

CREATE TABLE `languages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_localization` int(11) DEFAULT NULL,
  `type` varchar(16) DEFAULT NULL,
  `key` varchar(16) DEFAULT NULL,
  `message` text,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

/*Data for the table `languages` */

/*Table structure for table `localizations` */

DROP TABLE IF EXISTS `localizations`;

CREATE TABLE `localizations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `country` varchar(64) DEFAULT NULL,
  `timezone` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

/*Data for the table `localizations` */

/*Table structure for table `mapping` */

DROP TABLE IF EXISTS `mapping`;

CREATE TABLE `mapping` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_toko` int(11) DEFAULT NULL,
  `jenis_mapping` varchar(45) DEFAULT NULL,
  `id_data` varchar(16) DEFAULT NULL,
  `kode_akun` varchar(16) DEFAULT NULL,
  `created_at` date DEFAULT NULL,
  `created_by` varchar(64) DEFAULT NULL,
  `updated_at` date DEFAULT NULL,
  `updated_by` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

/*Data for the table `mapping` */

/*Table structure for table `member` */

DROP TABLE IF EXISTS `member`;

CREATE TABLE `member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_cabang` int(11) NOT NULL,
  `kode` varchar(64) NOT NULL,
  `id_jenis_member` int(11) NOT NULL,
  `id_pelanggan` int(11) NOT NULL,
  `tanggal_daftar` date NOT NULL,
  `tanggal_expired` date NOT NULL,
  `created_by` varchar(32) NOT NULL,
  `created_at` datetime NOT NULL,
  `updated_by` datetime DEFAULT NULL,
  `updated_at` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_member` (`id_jenis_member`) USING BTREE,
  KEY `idx_member_0` (`id_cabang`) USING BTREE,
  KEY `idx_member_1` (`id_pelanggan`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

/*Data for the table `member` */

